import "./styles.css";
// import the custom hook to use in this document
import useFetch from "./useFetch";
// Import JokeDisplay component for better testing structure
import JokeDisplay from "./JokeDisplay";

export default function App() {
  const url = "https://v2.jokeapi.dev/joke/Programming?type=single";
  // Use the custom hook here
  const { data, loading, error, getJoke } = useFetch(url);

  // Handle the New Joke button click
  const handleNewJoke = () => {
    getJoke();
  };

  return (
    <div className="App">
      <h1>Joke Generator</h1>

      {/* Using the JokeDisplay component for better testing structure */}
      <JokeDisplay 
        loading={loading} 
        error={error} 
        joke={data && data.joke}
      />

      <button 
        className="btn" 
        onClick={handleNewJoke}
      >
        New Joke
      </button>
    </div>
  );
}
